import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';
import './ProjectCard.css';

export default class ProjectCard extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return(
      <div className="projectCard">
        {this.props.title}
      </div>
    );
  }
}
